import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import Login from '../Routes/Login'; // Import your Login component
import Register from '../Routes/Register'; // Import your Register component
import PatientDashboard from '../Users/patient'; // Import your PatientDashboard component
import DoctorDashboard from '../Users/doctor'; // Import your DoctorDashboard component
import AdminDashboard from './AdminDashboard'; // Import your AdminDashboard component

function App() {
  const [isLogin, setIsLogin] = useState(true);
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => {
    // Simulate a login action and set the user data
    setUser(userData);
  };

  const handleLogout = () => {
    // Simulate a logout action
    setUser(null);
  };

  const handleSwitchAuth = () => {
    setIsLogin(!isLogin);
  };

  return (
    <Router>
      <div>
        <Navbar expand="lg" className="bg-body-tertiary">
          <Container>
            <Navbar.Brand href="#home">Your App</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                {/* Add navigation links for other pages */}
              </Nav>
              {user ? (
                <Navbar.Text>
                  Signed in as: {user.name}
                  <Button variant="link" onClick={handleLogout}>
                    Logout
                  </Button>
                </Navbar.Text>
              ) : (
                <Button variant="primary" onClick={handleSwitchAuth}>
                  {isLogin ? 'Register' : 'Login'}
                </Button>
              )}
            </Navbar.Collapse>
          </Container>
        </Navbar>

        <Switch>
          <Route exact path="/login">
            {user ? <Redirect to="/" /> : <Login onLogin={handleLogin} />}
          </Route>
          <Route exact path="/register">
            {user ? <Redirect to="/" /> : <Register onRegister={handleLogin} />}
          </Route>
          <Route exact path="/patient-dashboard">
            {user && user.role === 'patient' ? (
              <PatientDashboard user={user} />
            ) : (
              <Redirect to="/" />
            )}
          </Route>
          <Route exact path="/doctor-dashboard">
            {user && user.role === 'doctor' ? (
              <DoctorDashboard user={user} />
            ) : (
              <Redirect to="/" />
            )}
          </Route>
          <Route exact path="/admin-dashboard">
            {user && user.role === 'admin' ? (
              <AdminDashboard user={user} />
            ) : (
              <Redirect to="/" />
            )}
          </Route>
          <Redirect from="/" to="/login" />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
